import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import * as React from 'react'
import ClockInOutScreen from '../../screens/ClockInOutScreen';
import { routes } from '../../routes/index';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

const Tab = createBottomTabNavigator();

const Stack = createNativeStackNavigator();

export default function AuthenticatedScreenRouter() {
    return (
        <NavigationContainer>
            <Stack.Navigator initialRouteName={routes.clockinout.name}>
                <Stack.Screen name={routes.clockinout.name} options={{ title: routes.clockinout.title }} >
                    {(props) => <ClockInOutScreen {...props} />}
                </Stack.Screen>
            </Stack.Navigator>
            <Tab.Navigator>
                <Tab.Screen name={routes.clockinout.name} options={{ title: routes.clockinout.title }} >
                    {(props) => <ClockInOutScreen {...props} />}
                </Tab.Screen>
            </Tab.Navigator>
        </NavigationContainer>
    );
}
